import React from 'react';
import PropTypes from 'prop-types';

const RedBox = ({ children }) => {
  const boxStyle = {
    backgroundColor: '#BB0A21',
    width: '100vw',
    height: '100px',
    padding: '20px',
    boxSizing: 'border-box',
    color: 'white',
    textAlign: 'left',

  };

  return (
    <div style={boxStyle}>
      {children}
    </div>
  );
};
RedBox.propTypes = {
  children: PropTypes.node.isRequired,
};

export default RedBox;
